import React, { Component, useState, useEffect } from "react";
export default function StudentInfo(props) {
  const [info, setStudentInfo] = useState([
    {
      FIO: "Default",
      dateOfBirth: 1,
      universityEntranceDate: 1,
      faculty: "",
      group: 1,
      spec: "",
      email: "",
      telNumber: 1,
    },
  ]);
  return <div></div>;
}
